- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of your
    letter dated March 25, 2010 and offers the following response:    1.\tThe payment
    made to Pinellas County Supervisor of Elections was moved to Line 21b to reflect
    the purchase of voter file information to append to the voter file.  2.\tThe payments
    to Michael Maurino were not for fundraising events but rather Committee meetings
    and seminars, which are administrative expenses.  The purpose code has been changed
    to reflect this.  The payments made to Fantasy of Flight were catering costs for
    meeting expenses.  The payment made to Bullseye Interactive Media was for internet
    services.  The purpose codes have been amended to correctly reflect the meeting/admin
    related nature of the expenses.  3.\tThe itemization payment to Mr. Leonard Pepper
    was incorrectly listed, omitting the company name.  This amended reported correctly
    lists the entire vendor name - Doveree Properties, LLC, Atten: Mr. Leonard Pepper.
    \ The purpose for this payment was lodging.  4.\tThe H2 ratio for Conference 09
    has been corrected to reflect ?same? in this amended report.     ....  Transfers
    received from the DNC, DCCC, DSCC and candidate committees, not including ASDC/Dollars
    for Democrats and DNC Victory Fund, were not for joint fundraising.  None of the
    transfer in money received from the DNC or DCCC was used in the payments made
    for exempt activities.  None of the expenses listed on Line 21b were public communications
    or FEA activities.  None of the expenditures listed on Line 30b were expressed
    advocacy.  The payments listed on H4, including all consulting fees, were administrative/committee
    fundraising expenses and not FEA nor in connection with a federal election.  Payroll
    and all related expenses reported on Schedule H4 were for staff that did not spend
    more than 25% of their time on FEA or in connection with a federal election.    \n"
